import React from "react";
import "./styles.scss";
import strings from "../../en-NZ";
import ContentBlock from "../../components/ContentBlock/ContentBlock";

const content = [
  strings.about.iam,
  strings.about.recent,
  strings.about.self,
  strings.about.check,
];

const AboutSection = () => {
  return (
    <div className="about">
      <ContentBlock
        id="about-content"
        title={strings.about.title}
        content={content}
      />
      <div className="graph">
        <div className="graph-bar"></div>
        <div className="graph-label">HTML</div>
      </div>
      {/* </div> */}
      {/* </div> */}
    </div>
  );
};

export default AboutSection;
